from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
left = Motor(Port.B, Direction.COUNTERCLOCKWISE)
right = Motor(Port.A, Direction.CLOCKWISE)
front = Motor(Port.E, Direction.COUNTERCLOCKWISE)
top = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(left, right, 81, 90)

async def main():
    drive_base.use_gyro(True)
    print('Hello Pybricks!')
    front.control.limits(torque=800)
    drive_base.settings(straight_speed=350)
    await drive_base.turn(30)
    await drive_base.straight(90)
    await drive_base.turn(-30)
    await multitask(drive_base.straight(675), front.run_angle(200, -95))
    await front.run_angle(500, -55)
    await front.run_angle(500, 55)
    await drive_base.straight(-100)
    await drive_base.turn(-10)
    await front.run_angle(500, 100)
    await wait(500)
    await drive_base.turn(30)
    await front.run_angle(500, -110)
    await drive_base.turn(-20)
    await drive_base.straight(200)
    await drive_base.turn(-90)
    drive_base.settings(straight_speed=150)
    await drive_base.straight(-175)
    await wait(500)
    drive_base.settings(straight_speed=500)
    await drive_base.curve(200, -90, Stop.COAST)
    await multitask(drive_base.curve(350, 75), front.run_angle(500, -105))


run_task(main())